import './ListaT.css';
import React, { useState } from 'react';

function ListaT() {

    const [tareas, agregarTareas] = useState([])

    return (
    <div className = "listaTareas">
        <h1>Tareas:</h1>
        <li>
        {tareas}    
        </li>   
        <input></input>
        <button className="button" onClick={() => agregarTareas(tareas +  1)}>Incrementar</button>  
    </div>
    );
}

export default ListaT;
